import React from 'react'; 
import HomePage from './pages/HomePage'; 
import NotFoundPage from './pages/NotFountPage';
const routes = [
    {
        path:'/',
        exact:true,
        main: ()=> <HomePage/>
    },
    {
        path:'',
        exact:true,
        main: ()=> <NotFoundPage/>
    }
]
export default routes
